import React, { Component } from "react";

const ItemCodeTable = () => {
  return (
    <table className="table table-bordered table-sm m-2">
      <thead>
        <tr>
          <th>code</th>
          <th>Category</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>4444</td>
          <td>hhhhh</td>
        </tr>
      </tbody>
    </table>
  );
};

export default ItemCodeTable;
